import React from 'react';
import ReactDOM from 'react-dom';

function Card(props){
    console.log(props);
    return(
        <>
        <div className='cards'>
            <div className='card'>
            <img src='https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQfT8Djn2_GxurY_57fENNpA4ckwA0KvYVo1Q&s' alt='' className='card_img'>
                </img>
                <div className='card_info'>
                    <span className='card_category'>A Netflix Original Series </span>
                    <h3 className='card_title'>Heeramandi</h3>
                    <a href='https://www.netflix.com/in/title/81122198' target='_blank'>
                        <button>Watch Now</button>
                    </a>
                </div>
            </div>
        </div>
        </>
    );
}

ReactDOM.render(
    <>
       <Card imgsrc="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQfT8Djn2_GxurY_57fENNpA4ckwA0KvYVo1Q&s"
       title="A Netflix Original Series" sname="Heeramandi" link=""></Card>
       <Card></Card>
       <Card></Card>
{/* Instead of writing this div again we can use props in ReactJs. We can use $0.value to get any value . With the help of props we can create our wn attribute */}
    </>,
